import React from "react";

export default function Card() {
  return (
    <div>
      <div className="card mt-3" style={{ width: "18rem", maxHeight: "360px" }}>
        <img className="card-img-top" src="https://images.pexels.com/photos/2302809/pexels-photo-2302809.jpeg?auto=compress&cs=tinysrgb&w=600" alt="Food card" />
        <div className="card-body">
          <h5 className="card-title">Card title</h5>
          <p className="card-text">Food description and price.</p>
          <div className="container w-100">
            <select className="m-2 h-100 bg-success rounded">
              {Array.from(Array(6), (e, i) => {
                return (
                  <option key={i + 1} value={i + 1}>
                    {i + 1}
                  </option>
                );
              })}
            </select>

            <select className="m-2 h-100 bg-success rounded">
              <option value="half">Half</option>
              <option value="ful">Full</option>
            </select>

            <div className="d-inline h-100 fst-bold">Total Price</div>
          </div>
        </div>
      </div>
    </div>
  );
}
